import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { useAuth } from '../contexts/AuthContext';
import Button from './Button';
import './Navbar.css';

const Navbar = () => {
  const { user, logout, isAuthenticated } = useAuth();
  const navigate = useNavigate();
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [activeDropdown, setActiveDropdown] = useState(null);

  const handleLogout = () => {
    logout();
    navigate('/login');
  };

  const toggleMenu = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  const toggleDropdown = (category) => {
    setActiveDropdown(activeDropdown === category ? null : category);
  };

  const navigationCategories = {
    sales: {
      title: 'Sales',
      icon: 'üí∞',
      items: [
        { name: 'Point of Sale', path: '/pos', icon: 'üõí' },
        { name: 'Sales Management', path: '/sales-management', icon: 'üìä', adminOnly: true }
      ]
    },
    purchases: {
      title: 'Purchases',
      icon: 'üì¶',
      items: [
        { name: 'Purchase Orders', path: '/purchase-orders', icon: 'üìã' },
        { name: 'Suppliers', path: '/suppliers', icon: 'üè¢' }
      ]
    },
    inventory: {
      title: 'Inventory',
      icon: 'üì¶',
      items: [
        { name: 'Inventory Management', path: '/inventory', icon: 'üì¶' }
      ]
    },
    administration: {
      title: 'Administration',
      icon: '‚öôÔ∏è',
      items: [
        { name: 'Users', path: '/users', icon: 'üë•', adminOnly: true },
        { name: 'Tax Management', path: '/tax-management', icon: 'üìä', adminOnly: true },
        { name: 'Reports', path: '/reports', icon: 'üìà', adminOnly: true }
      ]
    }
  };

  return (
    <nav className="navbar">
      <div className="navbar-container">
        <Link to="/" className="navbar-brand">
          <h1>Beverage Manager</h1>
        </Link>

        {isAuthenticated && (
          <>
            <div className={`navbar-menu ${isMenuOpen ? 'active' : ''}`}>
              <Link to="/dashboard" className="navbar-link">
                Dashboard
              </Link>
              <Link to="/inventory" className="navbar-link">
                Inventory
              </Link>
              <Link to="/pos" className="navbar-link">
                Point of Sale
              </Link>
              <Link to="/purchase-orders" className="navbar-link">
                Purchase Orders
              </Link>
              <Link to="/suppliers" className="navbar-link">
                Suppliers
              </Link>
              {(user?.role === 'admin' || user?.role === 'manager') && (
                <>
                  <Link to="/users" className="navbar-link">
                    Users
                  </Link>
                  <Link to="/tax-management" className="navbar-link">
                    Tax Management
                  </Link>
                  <Link to="/sales-management" className="navbar-link">
                    Sales Management
                  </Link>
                  {user?.role === 'admin' && (
                    <Link to="/reports" className="navbar-link">
                      Reports
                    </Link>
                  )}
                </>
              )}
            </div>

            <div className="navbar-user">
              <div className="user-info">
                <span className="user-name">{user?.username}</span>
                <span className="user-role">{user?.role}</span>
              </div>
              <Button 
                variant="outline" 
                size="small" 
                onClick={handleLogout}
              >
                Logout
              </Button>
            </div>

            <button 
              className="navbar-toggle"
              onClick={toggleMenu}
              aria-label="Toggle menu"
            >
              <span></span>
              <span></span>
              <span></span>
            </button>
          </>
        )}
      </div>
    </nav>
  );
};

export default Navbar;
